import React from 'react';
import { Link } from 'react-router-dom';


const Navbar = () => {
    return (
        <nav className="mobile-hide">
                <Link to="#!" className="active">RECIPES</Link>
                <a href="#!">BEERS</a>
                <Link to="/login">LOGIN</Link>
        </nav>
    )
}

export default Navbar;
